import React from 'react'

function Menu() {
  return (
    <ul>
        <li><a href='/'><button>Home</button></a></li>
        <li><a href='/hr'><button>Human Resource</button></a></li>
        <li><a href='/finance'><button>Finance</button></a></li>
        <li><a href='/inventory'><button>Inventory</button></a></li>
    </ul>
  )
}

export default Menu;
